import { Row, Col, Divider } from 'antd';
import Header from './Header';
import Footer from './Footer';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD',
};

export default function Layout(props) {
  return (
    <Row gutter={12}>
      <Col className="gutter-row" span={12}>
        <div style={layoutStyle}>
          <Header />
          {props.children}
          <Footer />
        </div>
      </Col>
    </Row>
  );
}
